import reactRouterDom from 'react-router-dom';
import './App.css';
import Recipes from './Recipes';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'

function App() {
  return (
    <Router>
    <div className="App">
      <Switch>
        <Route path="/">
          <Recipes/>
        </Route>
      </Switch>
    </div>
    </Router>
  )
}

export default App;
